import './App.css';
import Home from './component/Home/Home/Home';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
function App() {
  return (
    <Router>
        <Routes>
          <Route path="/" element={<Home/>}/>
        </Routes>
    </Router>
  );
}

export default App;
